// http://localhost:5235
import React, { useState, useEffect } from 'react';
import axios from 'axios';

const PersonList = () => {
  const [persons, setPersons] = useState([]);

  useEffect(() => {
    fetchData();
  }, []);

  const fetchData = async () => {
    try {
      const response = await axios.get('http://localhost:5235/api/persons');
      setPersons(response.data);
    } catch (error) {
      console.error(error);
    }
  };

  return (
    <div className="container mt-3">
      <h2>Person List</h2>
      <ul className="list-group">
        {persons.map(person => (
          <li key={person.studentID} className="list-group-item">
            {person.fullName}
          </li>
        ))}
      </ul>
    </div>
  );
};

export default PersonList;
